import axios from "axios";
const baseURL = "https://test-api.atom6studio.com";

const api = axios.create({
  baseURL: "https://test-api.atom6studio.com",
});

export default {
  handleLogin: async (token) => {
    const response = await api
      .get("/auth/check", {
        headers: {
          Authorization: `Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VybmFtZSI6Im5pY2t6ZXJhIiwiaWF0IjoxNjU0NjU2NzQyLCJleHAiOjE2NTQ4Mjk1NDJ9.UCFtlvahwjK1yfuDd_ZX3WFwGXjUzRamDAbYOGSo3O4`,
        },
      })
      .then((res) => {
        console.log(res);
      });

    console.log(response);
  },
};
